import React, { Fragment } from 'react'

const SectionLeft = () => {
  return (
    <Fragment>
      <h2 className="title-bold">MARKETEUR DIGITAL</h2>
      <h3 className="featured-item-subheader italic">Bachelor, spécialisation Marketing</h3>
      <p className="featured-item-body">Etudes réalisées à Kedge Business School, où
        j'ai eu la chance de développer mes compétences numériques à travers de nombreux stages et expériences.
        J'ai également passé 2 ans en tant que responsable de la transition digitale pour le marché français au sein de l'entreprise, Royal Brinkman.
        Au cours de cette expérience j'ai appris à maîtriser différents outils tels que
            <strong>Mailchimp</strong>,
            Unbounce, Hotjar, <strong>Google Analytics</strong>, <strong>ahrefs</strong> ainsi que Joomla.</p>
    </Fragment>
  )
}

export default SectionLeft;
